import React from "react";

export default function Panels() {
  return (
    <div style={{ display: "flex" }}>
      <div style={{ minWidth: "450px" }}>Left</div>
      <div style={{ border: "0px 2px 2px 2px black" }}>Right</div>
    </div>
  );
}
